import Users from "./users";

export class Userlist extends React.Component {
  render() {
    const data = this.props.user;
let main;
const returnval = (
    data.then(users => {
         main = (
            <div className="container">
              <div className="row">
                {users.map(user => (
                  <div key={user.id} className="card">
                    <div className="card-body">{user.name}</div>
                  </div>
                ))}
              </div>
            </div>
          );

    })
)



    return main;
  }
}
